import React from 'react';
import '../app.css';


const NavComponent = () => {
        return (
            <ul className="nav">
                <li className="nav-item">
                    <a className="nav-link active" href="#">Active</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="#">Link</a>
                </li>
                <li className="nav-item">
                    <a className="nav-link" href="#">Link</a>
                </li>
                <li className="nav-item">
                </li>
            </ul>
        )
};

    export default NavComponent;
